import logo from './logo.svg';
import './App.css';
import { Signin } from './Signin';
import { Signup } from './Signup';

function App() {
  const [currentForm, setCurrentForm] = useState('login');
  return (
    <div className="App">
      {
        currentForm === "signin" ? <Signin /> : <Signup/>
      }
    </div>
  );
}

export default App;
